import React, { useState } from "react";
import SearchBar from "material-ui-search-bar";
import LinearProgress from "@material-ui/core/LinearProgress";

function Search(GetPackageDetails) {
  const [searchQuerry, setSearchQuerry] = useState();
  console.log(GetPackageDetails.getPackageDetails);
  function setNewVal(newVal) {
    console.log(newVal);
    console.log(setSearchQuerry);
  }
  return (
    <div className="searchbar">
      <SearchBar
        value={searchQuerry}
        placeholder="Add some food ..."
        autoFocus
        onChange={(newVal) => setSearchQuerry(newVal)}
        onRequestSearch={() =>
          GetPackageDetails.getPackageDetails(searchQuerry)
        }
      />
    </div>
  );
}

export default Search;
